import React from 'react';
import './App.css';
import { Link } from'react-router-dom'
import WidgetContainer from './WidgetContainer';

function App() {
  return (
    <div className="App">
      <Link to="/campaign">Campaign</Link>
      <Link to="/vip">VIP</Link>
      <WidgetContainer />
    </div>
  );
}

export default App;
